import React from 'react';
import { Input } from 'antd';
import './PaperScissorsRock.css';
//import lang from '../files/lang.json';
import RockImg from '../img/Rock.png';
import PaperImg from '../img/Paper.png';
import ScissorsImg from '../img/Scissors.png';
const { Search } = Input;


class PaperScissorsRock extends React.Component {
  constructor() {
    super();
    this.state={
      featuresGame:{
        firstFeat: RockImg,
        secondFeat: PaperImg,
        third: ScissorsImg
      }
    }
  }



  render() {
    return (
      <div className="container paper-scissor-rock-container">
        <h3>Podaj swoje imię i zagraj !</h3>
        <Search
          className="input-set-name"
          placeholder="Podaj swoje imię"
          enterButton="OK"
          size="large"
          onSearch={value => console.log(value)}
        />
        <div className="board-paper-scissor-rock">
          <img src={this.state.featuresGame.firstFeat} width={100} height={100} />
          <img src={this.state.featuresGame.secondFeat} width={100} height={100} />
          <img src={this.state.featuresGame.third} width={100} height={100} />
        </div>

      </div>
    );
  }
}


export default PaperScissorsRock;
